@LTequila4 @Alyssa_Milano I am amused that the same Republicans who shout "Lincoln was one of us!" are calling Volkswagon a Nazi car. 

VW (and Germany) made progress over the last 80 years and the GOP became so openly xenophobic, they lost their minds.

Things change.

@Giannis_cz @The_Amit_Rana @FINALLEVEL We’ll soon see, right?

Personally, I don’t care what happens. If it breaks, I’ll do something else. If it works, I’ll keep using it (until it really annoys me).

No matter what happens, my toes will still be tappin’.
